window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"24.1.0","implementation":{"name":"cucumber-jvm","version":"7.20.1"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"23.0.1+11-39"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1740469519,"nanos":519170300}}},{"source":{"uri":"file:\/\/\/C:\/Users\/mahaj\/git\/CodeCrackers_DsAlgo\/src\/test\/resources\/features\/Array.feature","data":"\r\nFeature: User sign in to DsAlgo page and Test the Array Module\r\n\r\n  Background: The user is on the sign-in page with login credentials\r\n\r\n    Given User is in the ds-algo launch page\r\n    When User clicks the Get Started button\r\n    Then login with \"Login_Valid\" and 1\r\n\r\n  Scenario: Verify that the user is able to click on Get Started button under Array section\r\n    Given User is on the Home page of dsalgo portal\r\n    When User clicks on Get Started button under Array section\r\n    Then User is navigated to Array page\r\n\r\n  Scenario: Verify that the user select Arrays option from Data Structures drop-down\r\n    Given User is on the Home page of dsalgo portal\r\n    When User selects Arrays option from Data Structures drop-down\r\n    Then User is navigated to Array page\r\n\r\n  Scenario: Verify that the Arrays in Python link is enabled in the Array page\r\n    Given The user is in the Array page after clicking on getstarted btn in array\r\n    And checks whether the Arrays in Python link is enabled\r\n    When The user clicks Arrays in Python link\r\n    Then The user should be able to navigate to Arrays in Python page\r\n\r\n  Scenario Outline: Verify that the user is able to see output for valid Python code entered\r\n    Given user is navigate to the tryEditor page after clicking on getstarted btn and then navigate to Implementation of Array module\r\n    When The user enter the valid pythoncode input from sheet '<Sheetname>' and <RowNumber> in Array module and clicks on run button\r\n    Then The user checks output in the console output\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Array     |         3 |\r\n     \r\n      \r\n    Scenario Outline: Verify that the user is able to see error message forinvalid Python code is entered\r\n   Given user is navigate to the tryEditor page after clicking on getstarted btn and then navigate to Implementation of Array module\r\n    When The user enter the invalid pythoncode input from sheet '<Sheetname>' and <RowNumber> in Array module and clicks on run button\r\n    Then The user checks output in the console output\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Array     |         2 |\r\n\r\n    Scenario: Verify that the user is able to navigate to Arrays using List page.\r\n    Given The user is in the Array page after clicking on getstarted btn in array\r\n    When The user clicks Arrays using List link\r\n    Then The user should be able to navigate to Arrays using List page\r\n\r\n  Scenario Outline: Verify that the user is able to see output for valid Python code and error message for invalid Python code and also when no code is entered\r\n     Given user is navigate to the tryEditor page after clicking on getstarted btn and then navigate to Array using list\r\n    When  The user enter the valid pythoncode input from sheet '<Sheetname>' and <RowNumber> in Array module and clicks on run button\r\n    Then The user checks output in the console output in Array module\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Array     |         4 |\r\n      \r\n      \r\n    Scenario Outline: Verify that the user is able to see output for valid Python code and error message for invalid Python code and also when no code is entered     Given user is navigate to the tryEditor page after clicking on getstarted btn and then navigate to Array using list\r\n     Given user is navigate to the tryEditor page after clicking on getstarted btn and then navigate to Array using list\r\n    When The user enter the invalid pythoncode input from sheet '<Sheetname>' and <RowNumber> in Array module and clicks on run button\r\n    Then The user checks output in the console output in Array module\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber | \r\n      | Array     |         5 |\r\n  Scenario: Verify that the user is able to navigate to Try Here >>> page for Basic Operations in Lists page\r\n    Given The user is in the Array page after clicking on getstarted btn in array\r\n    When user click on basic operation link\r\n    Then The user should be able to navigate to Basic Operations in Lists page\r\n\r\n  Scenario Outline: Verify that the user is able to see output for valid Python code is entered\r\n      Given The user is in the Array page after clicking on getstarted btn in array and navigate to Basic Operations in Lists page\r\n    When The user enter the valid pythoncode input from sheet '<Sheetname>' and <RowNumber> in Array module and clicks on run button\r\n    Then The user checks output in the console\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Array     |         6 |\r\n     \r\n Scenario Outline: Verify that the user is able to see output for valid Python code is entered\r\n      Given The user is in the Array page after clicking on getstarted btn in array and navigate to Basic Operations in Lists page\r\n    When The user enter the invalid pythoncode input from sheet '<Sheetname>' and <RowNumber> in Array module and clicks on run button\r\n    Then The user checks output in the console\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Array     |         7 |\r\n\r\n  Scenario Outline: Verify that the user is able to see output for valid Python code and error message for invalid Python code and also when no code is entered\r\n    Given The user is in the Array page after clicking on getstarted btn in array and navigate to the Applications of Array in Lists page\r\n  if Graph link is enabled\r\nThen Graph link should be enabled\r\n\r\nScenario: Verify that Graph Representations link is enabled\r\nGiven User is on Graph home page\r\nWhen User checks if Graph Representations link is enabled\r\nThen Graph Representations link should be enabled\r\n\r\n@Graph\r\nScenario: Verify that the user is able to navigate to Graph page\r\nGiven User is on Graph home page\r\nWhen User clicks on Graph link\r\nThen User is navigated to Graph page\r\n\r\nScenario: Verify that the user is able to click on Try here>>> button\r\nGiven User is on Graph page\r\nWhen User clicks on Try here>>> button of Graph page\r\nThen User is navigated to tryEditor page of Graph page\r\n\r\nScenario Outline: Verify that the user is able to see output for valid, invalid and incorrect syntax Python code entered for the Graph page\r\nGiven The user is in the Try Editor page for the Graph page\r\nWhen User enters valid, invalid and incorrect syntax code from excel sheet '<Sheetname>' and <RowNumber> and clicks on Run button for the Graph page\r\nThen The user should be able to get an output in the Try Editor screen for the Graph page\r\n\r\nExamples: \r\n  |Sheetname |RowNumber |\r\n  |TryEditor | 1|\r\n  |TryEditor | 2| \r\n  |TryEditor | 3|\r\n\r\nScenario: Verify that the user is able to navigate to Graph page after clicking <- in the Try Editor window\r\nGiven The user is in the Try Editor page of Graph page\r\nWhen The user clicks <- in the Try Editor screen of Graph page\r\nThen The user should be able to navigate to Graph page\r\n      \r\n@GraphRepresentations\r\nScenario: Verify that the user is able to navigate to Graph Representations page\r\nGiven User is on Graph page\r\nWhen User clicks on Graph Representations link\r\nThen User is navigated to Graph Representations page\r\n\r\nScenario: Verify that the user is able to click on Try here>>> button\r\nGiven User is on Graph Representations page\r\nWhen User clicks on Try here>>> button of Graph Representations page\r\nThen User is navigated to tryEditor page of Graph Representations page\r\n\r\nScenario Outline: Verify that the user is able to see output for valid, invalid and incorrect syntax Python code entered for the Graph Representations page\r\nGiven The user is in the Try Editor page for the Graph Representations page\r\nWhen User enters valid, invalid and incorrect syntax code from excel sheet '<Sheetname>' and <RowNumber> and clicks on Run button for the Graph Representations page\r\nThen The user should be able to get an output in the Try Editor screen for the Graph Representations page\r\n\r\nExamples: \r\n  |Sheetname |RowNumber |\r\n  |TryEditor | 1|\r\n  |TryEditor | 2| \r\n  |TryEditor | 3|\r\n\r\nScenario: Verify that the user is able to navigate to Graph Representations page after clicking <- in the Try Editor window\r\nGiven The user is in the Try Editor page of Graph Representations page\r\nWhen The user clicks <- in the Try Editor screen of Graph Representations page\r\nThen The user should be able to navigate to Graph Representations page\r\n  \r\n@PracticeQuestions\r\nScenario: Verify that the user is redirected to Practice Questions page of Graph module\r\nGiven User is on Graph Representations page\r\nWhen User clicks on Practice Questions link of Graph module\r\nThen User is navigated to Practice Questions page of Graph module\r\n\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/mahaj\/git\/CodeCrackers_DsAlgo\/src\/test\/resources\/features\/Graph.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Graph Module","description":"","children":[{"background":{"location":{"line":3,"column":1},"keyword":"Background","name":"The user is on the sign-in page with login credentials","description":"","steps":[{"location":{"line":4,"column":1},"keyword":"Given ","keywordType":"Context","text":"User is in the ds-algo launch page","id":"fa3a40aa-c3c4- ers\/mahaj\/git\/CodeCrackers_DsAlgo\/src\/test\/resources\/features\/LinkedList.feature","data":"Feature: Linked List Functionality\r\n\r\n  Background: The user is on the sign-in page with login credentials\r\n    Given User is in the ds-algo launch page\r\n    When User clicks the Get Started button\r\n    Then login with \"Login_Valid\" and 1\r\n\r\n  Scenario: Verify that the user is able to click on Get Started button under Linked List section\r\n    When User clicks on the Get Started button under Linked List section\r\n    Then User is navigated to Linked List page\r\n\r\n  Scenario: Verify that the Introduction link is enabled in the Linked List page\r\n    Given The user is in the Linked List page after Sign-In\r\n    When The user checks whether the Introduction link is enabled\r\n    Then The user should be able to see Introduction link enabled in the Linked List page\r\n\r\n  Scenario: Verify that the Creating Linked List link is enabled in the Linked List page\r\n    Given The user is in the Linked List page after Sign-In\r\n    When The user checks whether the Creating Linked List link is enabled\r\n    Then The user should be able to see Creating Linked List link enabled in the Linked List page\r\n\r\n  Scenario: Verify that the Types of Linked List link is enabled in the Linked List page\r\n    Given The user is in the Linked List page after Sign-In\r\n    When The user checks whether the Types of Linked List link is enabled\r\n    Then The user should be able to see Types of Linked List link enabled in the Linked List page\r\n\r\n  Scenario: Verify that the Implement Linked List in Python link is enabled in the Linked List page\r\n    Given The user is in the Linked List page after Sign-In\r\n    When The user checks whether the Implement Linked List in Python link is enabled\r\n    Then The user should be able to see Implement Linked List in Python link enabled in the Linked List page\r\n\r\n  Scenario: Verify that the Traversal link is enabled in .feature","name":"Verify user receives error message for Invalid Username and Password during Login","language":"en","steps":[{"astNodeIds":["508d1394-bc35-4405-8cdb-d5d71ba6a43b"],"id":"c9e19ed5-bba8-4ec5-9d30-efddb163e1ae","type":"Context","text":"User is in the ds-algo launch page"},{"astNodeIds":["aea6ac43-db50-491f-8241-bcc0c3f1cf3a"],"id":"68cd7f75-cde5-4623-9023-7c6f32393a25","type":"Action","text":"User clicks the Get Started button"},{"astNodeIds":["f801474d-a4e8-4af1-abf5-ca7f313bb27e","07bd77bd-4f11-4ac0-9a5b-6671802fb7df"],"id":"75b5612f-3c13-4ba2-93fc-097aa89b1978","type":"Context","text":"The user clicks the Sign In link"},{"astNodeIds":["000c0602-6012-4dcc-b4a9-2fe09712b2df","07bd77bd-4f11-4ac0-9a5b-6671802fb7df"],"id":"340aa648-99bc-4e75-a3c9-14e6fe2d3668","type":"Action","text":"The user gets invalid data from excel sheet 'Login' and 4 for the login page"},{"astNodeIds":["11d0af3f-1cae-4cb5-9127-8605de2d4cb0","07bd77bd-4f11-4ac0-9a5b-6671802fb7df"],"id":"a9e046df-6ec7-44da-988c-237392f3399e","type":"Outcome","text":"The user should be able to see an error message \"Invalid Username and Password\""}],"tags":[],"astNodeIds":["3e8ff43d-4ecc-4b4e-89f4-55df881c7ceb","07bd77bd-4f11-4ac0-9a5b-6671802fb7df"]}},{"source":{"uri":"file:\/\/\/C:\/Users\/mahaj\/git\/CodeCrackers_DsAlgo\/src\/test\/resources\/features\/Queue.feature","data":"Feature: Queue Module\r\n\r\n  Background: The user is on the sign-in page with login credentials\r\n    Given User is in the ds-algo launch page\r\n    When User clicks the Get Started button\r\n    And login with \"Login_Valid\" and 1\r\n\r\n  Scenario: Verify that the user is able to click on Get Started button under Queue section\r\n    When User clicks on the Get Started button under Queue section\r\n    Then User is navigated to Queue page\r\n\r\n  Scenario: Verify that the Implementation of Queue in Python link is enabled in the Queue page\r\n    Given The user is in the Queue page after Sign-In\r\n    When The user ch r\n\r\n  Scenario Outline: Verify that the user is able to get an error message when username (with special characters other than @) in the username field in the Register page is entered\r\n    Given User is in the Register page after clicking Register link in the home page\r\n    When User enters invalid data from excel sheet '<Sheetname>' and <RowNumber> for the username field\r\n    Then User should be able to get error message for username in the Register page\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Register  |         5 |\r\n      | Register  |         6 |\r\n\r\n  Scenario Outline: Verify that the user is able to enter password in the field\r\n    Given User is in the Register page after clicking Register link in the home page\r\n    When User wants to enter data from excel sheet '<Sheetname>' and <RowNumber> for the password field\r\n    Then User should be able to enter password after clicking Register button in the Register page\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Register  |         7 |\r\n      | Register  |         8 |\r\n      | Register  |         9 |\r\n      | Register  |        10 |\r\n\r\n  Scenario Outline: Verify that the user is able to get an error message\r\n    Given User is in the Register page after clicking Register link in the home page\r\n    When User enters invalid data from excel sheet '<Sheetname>' and <RowNumber> for the password field\r\n    Then User should be able to get an error message for password in the Register page\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | Register  |        11 |\r\n      | Register  |        12 |\r\n      | Register  |        13 |\r\n\r\n  Scenario Outline: Verify that the user is able to get a pop-up message when username, password and password confirmation field are left blank\r\n    Given User is in the Register page after clicking Register link in the home page\r\n    When The user enters data from excel sheet '<Sheet ack page\r\n\r\n  Scenario: Verify that the user is able to navigate to Operations in Stack page\r\n    Given The user is in the Stack page after Sign-In\r\n    When The user clicks Operations in Stack link in the Stack page\r\n    Then The user should be able to navigate to Operations in Stack page\r\n\r\n  Scenario: Verify that the user is able to navigate to Try Here >>> page for Operations in Stack page\r\n    Given The user is in the Operations in Stack page\r\n    When The user clicks Try Here >>> button in the Operations in Stack page\r\n    Then The user should be able to navigate to Stack Try Editor page with Run button to test\r\n\r\n  Scenario Outline: Verify that the user is able to see output for valid, invalid and incorrect syntax Python code is entered for the Operations in Stack page\r\n    Given The user is in the Try Editor page for the Operations in Stack page\r\n    When User enters valid, invalid and incorrect syntax code from excel sheet '<Sheetname>' and <RowNumber> and clicks on Run button for the Operations in Stack page\r\n    Then The user should be able to get an output in the Try Editor screen for the Operations in Stack page\r\n\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | TryEditor |         1 |\r\n      | TryEditor |         2 |\r\n      | TryEditor |         3 |\r\n\r\n  Scenario: Verify that the user is able to navigate to Implementation page\r\n    Given The user is in the Stack page after Sign-In\r\n    When The user clicks Implementation link in the Stack page\r\n    Then The user should be able to navigate to Implementation page\r\n\r\n  Scenario: Verify that the user is able to navigate to Try Here >>> page for Implementation page\r\n    Given The user is in the Implementation page\r\n    When The user clicks Try Here >>> button in the Implementation page\r\n    Then The user should be able to navigate to Stack Try Editor page with Run button to test\r\n\r\n  Scenario Outline: Verify that the user is able to
